function SubSplit(t, gdata, callback)
	local splitData = gdata()
	if splitData ~= nil then
		table.insert(t, splitData)
		
		FDBBSetProcessQueueRender(
			function()
				SubSplit(t,gdata,callback)
			end
		)
	else
		FDBBSetProcessQueue(
			function()
				callback(t)
			end
		)
	end
end

function Split(str, sep, callback)
	if callback == nil then
		if sep == nil then
			sep = "%s"
		end
		local t={}
		for str in string.gmatch(str, "([^"..sep.."]+)") do
			table.insert(t, str)
		end
		return t
	elseif callback ~= nil then
		if string.len(str) <= 500 then
			FDBBSetProcessQueueRender(
				function()
					SubSplitRender({},string.gmatch(str, "([^"..sep.."]+)"),callback)
				end
			)
		else
			FDBBSetProcessQueue(
				function()
					SubSplit({},string.gmatch(str, "([^"..sep.."]+)"),callback)
				end
			)
		end
	end
end

