end

function FDBBSetProcessQueue(Function)
	table.insert(FDBBMapperProcessQueue,Function)
end

function FDBBDoProcessTask()
	if #FDBBMapperProcessQueue > 0 then
		for F = 1, math.min(FDBBMapperProcessLimit,#FDBBMapperProcessQueue), 1 do
			FDBBMapperProcessQueue[1]()
			table.remove(FDBBMapperProcessQueue,1)
		end
	end
end

