-- FDBB Animation Function
function FDBBPlayAnimation(AnimationId,AnimationConfig)
	if FDBBAnimationBaseConfig.Animations[AnimationId] ~= nil then
		local ReNew = false
		if AnimationConfig ~= nil then
			if AnimationConfig.ReNew ~= nil then
				ReNew = AnimationConfig.ReNew
			end
		end
		if FDBBTimeCode[AnimationId] == nil or ReNew == true then
			local PlayMode = "forward"
			local PlaySpeed = 1
			local NextAnimation = nil
			if AnimationConfig ~= nil then
				if AnimationConfig.PlayMode ~= nil then
					PlayMode = AnimationConfig.PlayMode
				end
				if AnimationConfig.PlaySpeed ~= nil then
					PlaySpeed = math.floor(AnimationConfig.PlaySpeed)
					if PlaySpeed > FDBBAnimationBaseConfig.Animations[AnimationId][2] then
						PlaySpeed = FDBBAnimationBaseConfig.Animations[AnimationId][2]
					elseif PlaySpeed < 1 then
						PlaySpeed = 1
					end
				end
				if AnimationConfig.NextAnimation ~= nil then
					NextAnimation = AnimationConfig.NextAnimation
				end
				if AnimationConfig.ReNew ~= nil then
					ReNew = AnimationConfig.ReNew
				end
			end
			FDBBTimeCode[AnimationId] = {
				Id = AnimationId,
				PlayMode = PlayMode,
				PlaySpeed = PlaySpeed,
				LoopType = FDBBAnimationBaseConfig.Animations[AnimationId][3],
				NextAnimation = NextAnimation,
				TimeCal = (PlayMode == "reverse" and FDBBAnimationBaseConfig.Animations[AnimationId][2] or 1),
				TimeLength = FDBBAnimationBaseConfig.Animations[AnimationId][2]
			}
		else
			local PlayMode = "forward"
			local PlaySpeed = 1
			if AnimationConfig ~= nil then
				if AnimationConfig.PlayMode ~= nil then
					PlayMode = AnimationConfig.PlayMode
				end
				if AnimationConfig.PlaySpeed ~= nil then
					PlaySpeed = math.floor(AnimationConfig.PlaySpeed)
					if PlaySpeed > FDBBAnimationBaseConfig.Animations[AnimationId][2] then
						PlaySpeed = FDBBAnimationBaseConfig.Animations[AnimationId][2]
					elseif PlaySpeed < 1 then
						PlaySpeed = 1
					end
				end
			end
			FDBBTimeCode[AnimationId].PlayMode = PlayMode
			FDBBTimeCode[AnimationId].PlaySpeed = PlaySpeed
		end
	end
end

function FDBBAnimationIsPlaying(AnimationId)
	return (FDBBTimeCode[AnimationId] ~= nil and true or false)
end

function FDBBStopAnimation(AnimationId)
	if AnimationId ~= nil then
		FDBBAnimationModifyReset()
		if FDBBAnimationBaseConfig.Animations[AnimationId] ~= nil then
			local NewTimeCode = {}
			for AnimationTCId,TimeCode in pairs(FDBBTimeCode) do
				if AnimationTCId ~= AnimationId then
					NewTimeCode[AnimationTCId] = TimeCode
				end
			end
			FDBBTimeCode = NewTimeCode
		end
	end
end

function FDBBStopAllAnimation()
	FDBBAnimationModifyReset()
	FDBBTimeCode = {}
end

function FDBBHasAnimation(AnimationId)
	return (FDBBAnimationBaseConfig.Animations[AnimationId] ~= nil and true or false)
end
 
function FDBBAnimationModifyReset()
	for AnimationId,TimeCode in pairs(FDBBTimeCode) do
		for PartIdx,Part in pairs(FDBBAnimationBaseConfig.Animations[AnimationId][4]) do
			local PartId = Part[1]
			if PartId ~= "Effects" then
				FDBBRenderNormalizeSelect[PartId] = FDBBMapperProperties[PartId]
			end
		end
	end
	FDBBAnimationNormalize = true
end

function FDBBUseCustomAnimation(Set)
	FDBBCustomAnimation = Set
end
--[[
	-- Limitations --
	All cube names inside of a group in Blockbench must not be the same as the group name!

	-- Custom Preset Animation List --
	"Idle" (Standing Idle)
	"Walk" (Walk Forward)
	"Walk_R" (Walk Backward)
	"Sprint" (Sprint or Running)
	"JumpUp" (Jump Up)
	"JumpDown" (Jump Down)
	"Fall" (Fall Down)
	"Swimming" (Swimming In Water or Lava)
	"Flying" (Flight by Elytra)
	"FlyingDown" (Flight Down by Elytra)
	"Crouching" (Sneaking)
	"Crouching_F" (Sneaking Move Forward)
	"Crouching_B" (Sneaking Move Backward)
	"Riding" (Riding on Object)
	"SpinAttack" (Unique weapon Riptide special attack)
	"Sleeping" (Sleeping on bed)
	"Dying" (Rip or Dead)
	"Attacking_R" (Attack by left click)
	"Attacking_L" (Attack by right click)

	-- Custom FDBB Api --

	-- Required To Use Custom Animation -- (Enable base animations like idle,walk,run or disable from trace to play some custom animation)
	FDBBUseCustomAnimation(Set)
	- Set <boolean type>(true to pause all animation presets and false to make preset animations work normally)

	-- Play Animation -- (Play animation from Blockbench)
	FDBBPlayAnimation(AnimationId,AnimationConfig)
	- AnimationId <string type>(Animation name in Blockbench)
	- AnimationConfig <object type>(Extra object setting for play animation)
	-- [PlayMode] <string type>("forward"|"reverse")
	-- [PlaySpeed] <int type>(multiply tick for animation speed)
	-- [NextAnimation] <same as call this function>(AnimationId,AnimationConfig)
	-- [ReNew] <boolean>(force play animation from start animation again)

	-- Stop Animation -- (Stop animation that is playing)
	FDBBStopAnimation(AnimationId)
	- AnimationId <string type>(Animation name in Blockbench)

	-- Stop All Animation -- (Stop all animations that are playing)
	FDBBStopAllAnimation()

	-- Check Has Animation -- (Check animation is exist or not)
	FDBBHasAnimation(AnimationId)
	- AnimationId <string type>(Animation name in Blockbench)
		
	-- Reset Modify Render -- (Stop all modify from animation for reset and use new animation)
	FDBBAnimationModifyReset()
]]

